import './index.css';
import * as React from "react";
import * as ReactDOM from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Login from './routes/login';
import MainRoute from './routes/mainRoute';
import Empty from './routes/empty'
import Error from './routes/error';
import Srials from './routes/serials';
import {getAllSerials} from './api';

const base_url = process.env.BASE_URL + ":8000/"

const router = createBrowserRouter([
  {
    path: "/",
    element: < MainRoute />,
    errorElement: <Error />,
    children:[
      {
        path: "serials/",
        element: <Srials/>,
        loader: getAllSerials,
      }
    ]
  },
  {
    path: "/login",
    element: <Login />,
  },
]);


function App() {
  return <RouterProvider router={router} />;
}

export default App;
